import './style.css';
import { Navigate } from "react-router-dom";

function telaInicial(){
      
    render(

        <div>
            <Navigate to="/logar" replace={true} />
            <p>TESTE</p>
            <input type='text'></input>
            </div>
    )
        
            
        
    
}

export default telaInicial;
